Giant Squid: Filming the Impossible

Science Documentary hosted by David Attenborough, published by BBC broadcasted as part of BBC Natural World series in 2013 - English narration


Information
------------------------------

David Attenborough narrates this documentary about the giant squid, a creature of legend and myth which even in the 21st century, has rarely been seen in it's natural environment. But now, an international team of scientists think they have finally found their lair, one thousand metres down, off the coast of Japan.
This is the culmination of decades of research. The team deploys underwater robots and state of the art submersible vessels for a world first - to find and film the impossible.
An NHK and Discovery Channel production.

